import React, { useState, useEffect } from "react";
import { useSelector } from "react-redux";

export default function OwnerDashboard() {
  const { isAuthenticated, role } = useSelector((state) => state.auth);

  // Profile state
  const [profile, setProfile] = useState({
    agentId: "", // Use agentId instead of userId
    userName: "",
    contact: "",
    email: "",
    address: "",
    gstNo: "",
    password: "",
  });
  const [loading, setLoading] = useState(false);
  const [isEditing, setIsEditing] = useState(false); // Track edit mode

  // Handle form changes
  const handleChange = (e) => {
    const { name, value } = e.target;
    setProfile({ ...profile, [name]: value });
  };

  // Handle the update profile API call
  const handleUpdateProfile = () => {
    setLoading(true);
    fetch(`/api/car-rental-agencies/${profile.agentId}`, {
      // Updated with agentId
      method: "PUT",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(profile),
    })
      .then((response) => response.json())
      .then((data) => {
        setProfile(data);
        setIsEditing(false); // Switch to view mode after updating
        setLoading(false);
      })
      .catch((error) => {
        console.error("Error updating profile:", error);
        setLoading(false);
      });
  };

  // Fetch the profile data on initial load
  useEffect(() => {
    if (isAuthenticated) {
      // Fetch profile from the API using agentId
      fetch(`/api/car-rental-agencies/${profile.agentId}`) // Replace with actual API endpoint
        .then((response) => response.json())
        .then((data) => {
          setProfile(data);
        })
        .catch((error) => console.error("Error fetching profile:", error));
    }
  }, [isAuthenticated, profile.agentId]);

  return (
    <div>
      <h2>Owner Dashboard</h2>
      {role?.roleName === "Agency" && isAuthenticated ? (
        <div>
          <h3>Profile</h3>
          {isEditing ? (
            <div>
              <label>
                User Name:
                <input
                  type="text"
                  name="userName"
                  value={profile.userName}
                  onChange={handleChange}
                />
              </label>
              <label>
                Email:
                <input
                  type="email"
                  name="email"
                  value={profile.email}
                  onChange={handleChange}
                />
              </label>
              <label>
                Contact:
                <input
                  type="text"
                  name="contact"
                  value={profile.contact}
                  onChange={handleChange}
                />
              </label>
              <label>
                Address:
                <input
                  type="text"
                  name="address"
                  value={profile.address}
                  onChange={handleChange}
                />
              </label>
              <label>
                GST No:
                <input
                  type="text"
                  name="gstNo"
                  value={profile.gstNo}
                  onChange={handleChange}
                />
              </label>
              <label>
                Password:
                <input
                  type="password"
                  name="password"
                  value={profile.password}
                  onChange={handleChange}
                />
              </label>
              <button onClick={handleUpdateProfile} disabled={loading}>
                {loading ? "Updating..." : "Update Profile"}
              </button>
              <button onClick={() => setIsEditing(false)}>Cancel</button>
            </div>
          ) : (
            <div>
              <p>
                <strong>Agent ID:</strong> {profile.agentId}
              </p>
              <p>
                <strong>User Name:</strong> {profile.userName}
              </p>
              <p>
                <strong>Email:</strong> {profile.email}
              </p>
              <p>
                <strong>Contact:</strong> {profile.contact}
              </p>
              <p>
                <strong>Address:</strong> {profile.address}
              </p>
              <p>
                <strong>GST No:</strong> {profile.gstNo}
              </p>
              <button onClick={() => setIsEditing(true)}>Edit Profile</button>
            </div>
          )}
        </div>
      ) : (
        <p>Please log in as an agency owner.</p>
      )}
    </div>
  );
}
